import { createMuiTheme } from "@material-ui/core/styles";

const fixWhite = "#F5F5F5";
const fixBlue = "#1976d2";

export default createMuiTheme({
  palette: {
    common: {
      fixBlue: `${fixWhite}`,
      fixOrange: `${fixOrange}`,
    },
    primary: {
      main: `${fixWhite}`,
    },
    secondary: {
      main: `${fixOrange}`,
    },
  },
  typography: {},
});
